import React from 'react'
import './myStyle.css'
import Card from './Card'
import Card2 from './Card2'
import Card3 from './Card3'
import Card_general from './Card_general'


interface data {
    ks: string;
    gini: string;
    variables:string ;
}

function CardBox(props:data) {
  return (
    <div className='cardBox'>
      <Card numero= {props.ks} frase="KS"  />
      <Card2 numero={props.gini} frase="Gini"  />
      <Card3 numero={props.variables} frase="Variables"  />
      <Card_general numero="66" frase="Variables" icono="check-square" />
    </div>
  )
}

export default CardBox;
